import React from "react";
import "./table-wrapper.css";

const TableWrapper = () => {
  return (
    <div className="tableWrapperWrapper">
      <div className="tableWrapperTextWrapper">
        <p className="tableWrapperText1">1</p>
        <p>2</p>
        <p>3</p>
      </div>
    </div>
  );
};

export default TableWrapper;
